function getNumber(array){
    if (array.length == 0)
        return 1;
    else 
        array = array.filter(element => element > 0)
    if (array.length == 0)
        return 1;
    else {
        array = [... new Set(array)]
        mergeSort(array, 0, array.length - 1)
        if (array[0] != 1) return 1;
        return binarySearch(array, 0, array.length-1)
    }
}
// main function that sorts array[start..end] using merge()
function mergeSort(array, start, end) {
  // base case
  if (start < end) {
    // find the middle point
    let middle = Math.floor((start + end) / 2)

    mergeSort(array, start, middle) // sort first half
    mergeSort(array, middle + 1, end)  // sort second half

    // merge the sorted halves
    merge(array, start, middle, end)
  }
}

// merges two subarrays of array[]
function merge(array, start, middle, end) {
  // create temp arrays
  let leftArrayLength = middle - start + 1
  let rightArrayLength = end - middle

  let leftArray = []
  let rightArray = []

  // fill in left array
  for (let i = 0; i < leftArrayLength; ++i)
    leftArray[i] = array[start + i]

  // fill in right array
  for (let i = 0; i < rightArrayLength; ++i)
    rightArray[i] = array[middle + 1 + i]

  // merge the temp arrays

  // initial indexes of first and second subarrays
  let leftIndex = 0, rightIndex = 0

  // the index we will start at when adding the subarrays back into the main array
  let currentIndex = start;

  // compare each index of the subarrays adding the lowest value to the currentIndex
  while (leftIndex < leftArrayLength && rightIndex < rightArrayLength) {
    if (leftArray[leftIndex] <= rightArray[rightIndex])
      array[currentIndex] = leftArray[leftIndex++]
    else
      array[currentIndex] = rightArray[rightIndex++]
    currentIndex++
  }

  // copy remaining elements of leftArray[] if any
  while (leftIndex < leftArrayLength) array[currentIndex++] = leftArray[leftIndex++]

  // copy remaining elements of rightArray[] if any
  while (rightIndex < rightArrayLength) array[currentIndex++] = rightArray[rightIndex++]
}

function binarySearch(arr, start, end) {
      
    // Base Condition
    if (start > end) return arr[arr.length -1]+1;
  
    // Find the middle index
    let mid=Math.floor((start + end)/2);
  
    // Compare mid with given key x
    if (arr[mid]==mid+1 && arr[mid+1] != mid+2) return mid+2;
         
    // If element at mid is greater than x,
    // search in the left half of mid
    console.log(arr[mid], " ", mid+1)
    if(arr[mid] > mid+1)
        return binarySearch(arr, start, mid-1);
    else
        // If element at mid is smaller than x,
        // search in the right half of mid
        return binarySearch(arr, mid+1, end);
}

